import React from "react";
import './Tags.css'

const Tags = () => {
    return (
        <div>
            <header>Tags</header>
            <ul>
                <li>Study</li>
                <li>Food</li>
                <li>Travel</li>
            </ul>
        </div>
    )
}

export default Tags
